/*Random Data Generator */
function sinAndCos() {
    var sin = [],sin2 = [], cos = [];
    var data = [];

    //Data is represented as an array of {x,y} pairs.
    for (var i = 0; i < 100; i++) {
        let obj = {};
        obj.time = i;
        if (Math.random() > 0.05) obj.sin = Math.sin(i/10);
        if (Math.random() > 0.05) obj.sin2 = Math.sin(i/10) *0.25 + 0.5;
        if (Math.random() > 0.05) obj.cos = 0.5 * Math.cos(i/10+ 2) + Math.random() / 2;
        data.push(obj);
    }
    return data;
}

msg.payload = sinAndCos();

return msg;

var time = 2*Math.PI * ((new Date()).valueOf() % 20000) / 20000;
msg.payload = {
    time: new Date(),
    sin: Math.sin(time),
    cos: Math.cos(time)
};

return msg;
